        {props.images.map((image, key) => {
          imageSrc = "about/" + image
          return <img src={image} alt="" />;
        })}

        <img src="about/about2.jpeg" alt="" />
        <img src="about/about3.jpeg" alt="" />
      </div>
    </div>
  );
};
